
public class classFontion {

	
	public static void affichtableau(Integer [] tableau)
	
	{
		for (int i=0; i< tableau.length; i++)
			System.out.println(tableau[i]+ " ");
		
	}
	
	public static void main(String[] args) {
	
		// TODO Auto-generated method stub
		
		Integer[] tab1 ={2,3};
		
		 affichtableau(tab1);
	}
	 
}
